        print_report: function () {
            // Set opacity to 0 for all elements with the 'i_icon' class
            document
                .querySelectorAll(".i_icon")
                .forEach((element) => (element.style.opacity = "0"));

            // Hide elements with the 'do_not_print' class and apply additional styles
            document.querySelectorAll(".do_not_print").forEach((element) => {
                element.style.display = "none";
                element.setAttribute("style", "display: none !important;");
            });

            // Hide the print preview element
            const printPreview = document.querySelector(".print_preview");
            if (printPreview) printPreview.style.display = "none";

          
            document.querySelectorAll(".bg-input").forEach((element) => {
                element.style.setProperty("background-color", "#ffffff12", "important")
            });
        
            

            // Trigger the print dialog
            window.print();
            // const month = this.$route.params.month;
            // const user_id = this.$route.params.user_id;
            // const url = `/thana/report?user_id=${user_id}&month=${month}&print=true`;
            // window.location.href = url;

            // setTimeout(() => {
            //     window.print(); // Trigger the print dialog
            // }, 200);
        },

        implementation_rate: function (target, achieved) {
            if (target && achieved) {
                return (
                    this.formatBangla(Math.floor((achieved / target) * 100)) +
                    "%"
                );
            }
            return " ";
        },

        report_status: async function () {
            const month = this.$route.params.month;
            let response = await axios.get("/thana/report-status", {
                params: {
                    month: month,
                },
            });
            if (response.data.status == "success") {
                this.joma_status = response.data.report_status;
                console.log("report_status", response);
            }
        },
        report_joma: async function () {
            if (window.confirm("আপনি কি জমা দানের বিষয়ে নিশ্চিত?")) {
                const month = this.$route.params.month;
                let response = await axios.get("/thana/report-joma", {
                    params: {
                        month: month,
                    },
                });
                if (response.data.status == "success") {
                    // this.$router.push({ name: "Montobbo" });
                    this.report_status();
                    window.toaster(response.data.message, "success");

                    this.joma_status = response.data.report_status;
                    console.log("report_status", response);
                }
            } else {
                window.toaster(
                    "রিপোর্ট জমা বন্ধ করা হয়েছে । অনুগ্রহ করে সমস্ত প্রয়োজনীয় তথ্য পূরণ করুন ",
                    "info"
                );
            }
        },
        toggle_popup(event) {
            const parent = event.currentTarget.closest(".unit_info_icon");
            const popup = parent.querySelector(".unit_data_popup");
            if (popup) {
                popup.style.display =
                    popup.style.display === "block" ? "none" : "block";
            }
        },

        total_man_woman_count: function (man, woman) {
            const total = Number(man || 0) + Number(woman || 0);
            return this.formatBangla(total);
        },
        get_sum_total: function (...args) {
            let value = args.reduce((sum, num) => sum + Number(num || 0), 0);
            return this.formatBangla(value);
        },
        handleAfterPrint() {
            location.reload();
        },
        disable_inputs() {
            console.log("disable_inputs");
            const inputs = document.querySelectorAll('input');
            console.log("inputs",inputs);
            inputs.forEach(input => {
                input.disabled = true;
            });
        },
    },
    computed: {
        total_dawat: function () {
            const total =
                Number(
                    this.report_sum_data?.ward_dawat1_regular_group_wises
                        ?.how_many_have_been_invited || 0
                ) +
                Number(
                    this.report_sum_data?.ward_dawat2_personal_and_targets
                        ?.how_many_have_been_invited || 0
                ) +
                Number(
                    this.report_sum_data?.ward_dawat3_general_program_and_others
                        ?.how_many_were_give_dawat || 0
                ) +
                Number(
                    this.report_sum_data
                        ?.ward_dawat4_gono_songjog_and_dawat_ovijans
                        ?.how_many_have_been_invited || 0
                ) +
                Number(
                    this.report_sum_data
                        ?.ward_dawat4_gono_songjog_and_dawat_ovijans
                        ?.jela_mohanogor_declared_gonosonjog_invited || 0
                ) +
                Number(
                    this.report_sum_data
                        ?.ward_dawat4_gono_songjog_and_dawat_ovijans
                        ?.election_how_many_have_been_invited || 0
                ) +
                Number(
                    this.report_sum_data
                        ?.ward_dawat4_gono_songjog_and_dawat_ovijans
                        ?.other_how_many_have_been_invited || 0
                );
            return this.formatBangla(total);
        },
    },
    mounted() {
        window.addEventListener('afterprint', this.handleAfterPrint);
        this.disable_inputs();
    },
    beforeUnmount() {
        window.removeEventListener('afterprint', this.handleAfterPrint);
    },
        
